reate a %s file through a web interface, but this doesn\'t work for all server setups. The safest way is to manually create the file.'=>'Faili %s saab luua veebiliidese kaudu, kuid see ei tööta igal serveril. Kõige kindlam on luua see käsitsi.','You can navigate to other pages on your site while using the Customizer to view and edit the widgets displayed on those pages.'=>'Mooduleid Kohandaja abil muutes ja vaadates võid samal ajal liikuda ka teistele lehtedele.','You can see all comments on this post here:'=>'Kõik selle postituse kommentaarid on siin:','You can see all pingbacks on this post here:'=>'Kõik selle postituse pingback-viited:','You can see all trackbacks on this post here:'=>'Kõik selle postituse tagasisideviited:','You cannot use that email address to signup. There are problems with them blocking some emails from WordPress. Please use another email provider.'=>'Seda e-postiaadressi ei saa registreerumisel kasutada. Nad kipuvad mõningaid WordPressi e-postiaadresse blokeerima. Palun vali mõni teine teenusepakkuja.','You have attempted to queue too many files.'=>'Oled seadnud ootejärjekorda liiga palju faile.','You have been added to this site. Please visit the <a href="%1$s">homepage</a> or <a href="%2$s">log in</a> using your username and password.'=>'Sind lisati sellele veebilehele. Palun külasta <a href="%1$s">avalehte</a> või <a href="%2$s">logi sisse</a> oma kasutajanime ja parooliga.','You have logged in successfully.'=>'Oled edukalt sisse logitud.','You have searched the %1$s blog archives for <strong>&#8216;%2$s&#8217;</strong>. If you are unable to find anything in these search results, you can try one of these links.'=>'Otsisid %1$s arhiivist: <strong>&#8216;%2$s&#8217;</strong>. Kui otsing ei aita, võid proovida mõnda neist viidetest.','You have used your space quota. Please delete files before uploading.'=>'Sinu kettaruum on täis saanud. Palun kustuta osa faile enne üleslaadimist ära.','You may only upload 1 file.'=>'Sa saad üles laadida üksn